post_text:
This week is our first pep rally! {THURSDAY @ 3:30}
"SAY ALOHA TO FOOTBALL SEASON!"

Wear a luau or beach outfit and pump up our BRAVES as they get prepared for their first game of the season against Walnut Springs this {Friday @ 7:30PM} here at TW!

